import React, {Component} from 'react';
import Customer from "./components/Customer"

const customer = [
  {
    'id':1,
    'name':'홍길동',
    'birthday':'961003',
    'gender':'남자',
    'job':'대학생'
  },
  {
    'id':2,
    'name':'홍길',
    'birthday':'961004',
    'gender':'남자',
    'job':'대학생'
  },
]


class App extends Component{
  render(){
    return(
      <Customer 
      id = {customer.id}
      name = {customer.name}
      birthday = {customer.birthday}
      gender = {customer.gender}
      job = {customer.job}
      />
    )
  }
}

export default App;
